    has no federal candidates on the ballot during 2009. The Committee employs one
    full time employee, the Executive Director, whose time is more than 25 percent
    devoted to federal elections and candidates.  The salary, health benefits costs
    and taxes of the Executive Director are reported on Schedule B supporting line
    30(b) of this report. The Committee also employs four full time consultants working
    exclusively on non federal candidates and elections, and their compensation is
    paid with non federal funds and not a part of this report. No other entity pays
    compensation for their employees to work for the committee.  The Committee does
    not engage in any fundraising on behalf of candidates for Federal office, so all
    of its reported fundraising expenses are party fundraising. The Committee maintains
    both Federal and Non Federal accounts.  During July 2009, eligible, allocable
    administrative expenses were transferred from the non federal account to the federal
    account, on the 15-percent Federal, 85-percent nonfederal split for June 2009
